if (youtubeLink.startsWith("https://www.youtube.com/watch?v=")) {
  videoId = youtubeLink.replace("https://www.youtube.com/watch?v=", "");
} else if (youtubeLink.startsWith("https://m.youtube.com/watch?v=")) {
  videoId = youtubeLink.replace("https://m.youtube.com/watch?v=", "");
} else if (youtubeLink.startsWith("https://www.youtube.com/v/")) {
  const parts = youtubeLink.split("/");
  videoId = parts[parts.length - 1];
} else if (youtubeLink.startsWith("https://www.youtube.com/embed/")) {
  const parts = youtubeLink.split("/");
  videoId = parts[parts.length - 1];
} else if (youtubeLink.startsWith("https://music.youtube.com/watch?v=")) {
  videoId = youtubeLink.replace("https://music.youtube.com/watch?v=", "");
} else if (youtubeLink.startsWith("https://gaming.youtube.com/watch?v=")) {
  videoId = youtubeLink.replace("https://gaming.youtube.com/watch?v=", "");
} else if (youtubeLink.startsWith("https://youtu.be/")) {
  const startString = "https://youtu.be/";
  const endString = "?si=";
  const startIndex = youtubeLink.indexOf(startString);
  const endIndex = youtubeLink.indexOf(endString);

  if (startIndex !== -1 && endIndex !== -1) {
    videoId = youtubeLink.substring(startIndex + startString.length, endIndex);
  }
} else {
  console.error("Invalid YouTube link format");
}

