});

// –§—É–Ω–∫—Ü–∏—è –¥–ª—è –ø—Ä–æ–≤–µ—Ä–∫–∏ —Å—É—â–µ—Å—Ç–≤–æ–≤–∞–Ω–∏—è –≤–∏–¥–µ–æ –ø–æ —Å—Å—ã–ª–∫–µ
async function checkVideoExistence(videoUrl) {
    try {
        // –ò–∑–≤–ª–µ—á–µ–Ω–∏–µ –∏–¥–µ–Ω—Ç–∏—Ñ–∏–∫–∞—Ç–æ—Ä–∞ –≤–∏–¥–µ–æ –∏–∑ —Å—Å—ã–ª–∫–∏
        const videoId = getVideoIdFromUrl(videoUrl);

        // –ü—Ä–æ–≤–µ—Ä–∫–∞ –Ω–∞–ª–∏—á–∏—è –∏–¥–µ–Ω—Ç–∏—Ñ–∏–∫–∞—Ç–æ—Ä–∞ –≤–∏–¥–µ–æ
        if (!videoId) {
            throw new Error('Invalid video URL');
        }

        // –í—ã–ø–æ–ª–Ω–µ–Ω–∏–µ –∑–∞–ø—Ä–æ—Å–∞ –∫ YouTube Data API v3
        const response = await youtube.videos.list({
            part: 'id',
            id: videoId
        });

        // –ü—Ä–æ–≤–µ—Ä–∫–∞ –Ω–∞–ª–∏—á–∏—è –¥–∞–Ω–Ω—ã—Ö –æ –≤–∏–¥–µ–æ –≤ –æ—Ç–≤–µ—Ç–µ
        if (response.data.items.length > 0) {
            return true; // –í–∏–¥–µ–æ —Å—É—â–µ—Å—Ç–≤—É–µ—Ç
        } else {
            return false; // –í–∏–¥–µ–æ –Ω–µ —Å—É—â–µ—Å—Ç–≤—É–µ—Ç
        }
    } catch (error) {
        throw new Error('Error checking video existence: ' + error.message);
    }
}

// –§—É–Ω–∫—Ü–∏—è –¥–ª—è –∏–∑–≤–ª–µ—á–µ–Ω–∏—è –∏–¥–µ–Ω—Ç–∏—Ñ–∏–∫–∞—Ç–æ—Ä–∞ –≤–∏–¥–µ–æ –∏–∑ —Å—Å—ã–ª–∫–∏
function getVideoIdFromUrl(videoUrl) {
    const match = videoUrl.match(/(?:https?:\/\/)?(?:www\.)?(?:youtube\.com\/(?:[^\/\n\s]+\/\S+\/|(?:v|e(?:mbed)?)\/|\S*?[?&]v=)|youtu\.be\/)([a-zA-Z0-9_-]{11})/);
    return match ? match[1] : null;
}

